import styles from './navbar.module.scss';

const Navbar = () => {
  return (
    <nav className={styles.navbar}>
      <h1>The Dojo Blog</h1>
      <div className={styles.links}>
        <a href="/">Home</a>
        <a href="/create" style={{
          color: 'white',
          backgroundColor: '#f1356d',
          borderRadius: '8px',
        }}>New Blog</a>
      </div>
    </nav>
  );
}

export default Navbar;
